import React from 'react';

const Subscriptions = (props) => {

  const {books} = props;

  return (
    <>
     {subscritionBooks.length > 0 ?  
     <div className="page">
       <div className="main">
        <Header />
       <div className="books books_subscriptions">
         {books.map((book) => {
           return (
             <Book 
               key = {book.id}
               book = {book}
               bookName={bookName}
               setActiveBook={setActiveBook}
               unsetActiveBook={unsetActiveBook}
             />
           );
         })}
        <BooksList books={books} bookName="SUBSCRIPTIONS"/>
       </div>
        <Footer />	
       </div>
       <button className="up-button" type="button">
        ↑
        <span className="visually-hidden">Наверх</span>
       </button>
     </div> : <SubscribtionsEmpty /> }
   </>

 )
};

const mapStateToProps = (state) => ({
  books: state.books,

});

export {Subscriptions};
export default connect(mapStateToProps, mapDispatchToProps)(SubscriptionsList);
